import React, { useState, useEffect } from "react";

const CustomerProfile = (props) => {
  const [customerId, setCustomerId] = useState(null);

  useEffect(() => {
    setCustomerId(props.id);
  }, []);

  if (customerId) {
    return <h1>Customer Profile</h1>;
  } else {
    return null;
  }
};

export default CustomerProfile;
